  "data": {
    "potential_causes": [
      {
        "cause_id": "a1b2c3d4-e5f6-7g8h-9i10-j11k12l13m14",
        "name_localized": "Stress and Mental Fatigue",
        "suggestion_localized": "Practice relaxation techniques and ensure adequate rest.",
        "explanation_localized": "Stress from daily responsibilities and mental exhaustion are common causes of headaches, especially in individuals over 60 who may experience increased stress or worry."
      },
      {
        "cause_id": "b2c3d4e5-f6g7-8h9i-10j11-k12l13m14n15",
        "name_localized": "Dehydration",
        "suggestion_localized": "Ensure sufficient fluid intake throughout the day.",
        "explanation_localized": "Older adults are at higher risk of dehydration, which can trigger headaches. Adequate hydration is essential for overall health."
      },
      {
        "cause_id": "c3d4e5f6-g7h8-9i10-j11k12l13m14n15",
        "name_localized": "Poor Sleep Quality",
        "suggestion_localized": "Establish a regular sleep routine and create a comfortable sleep environment.",
        "explanation_localized": "Sleep disturbances are common with age and can lead to headache episodes due to disrupted circadian rhythms and rest deficits."
      },
      {
        "cause_id": "d4e5f6g7-h8i9-10j11-k12l13m14n15o16",
        "name_localized": "Postural Strain or Muscle Tension",
        "suggestion_localized": "Ensure ergonomic support and engage in gentle stretching exercises.",
        "explanation_localized": "Muscle tension, especially in the neck and shoulders, can cause tension headaches, more prevalent in seniors with limited mobility or poor posture."
      },
      {
        "cause_id": "e5f6g7h8-i9j10-11k12-l13m14n15o16p17",
        "name_localized": "Environmental Factors",
        "suggestion_localized": "Improve lighting, reduce noise, and ensure good air quality in your environment.",
        "explanation_localized": "Environmental irritants such as bright lights, loud noises, or poor air quality can contribute to headache episodes, particularly in sensitive individuals."
      },
      {
        "cause_id": "f6g7h8i9-j10k11-12l13-m14n15o16p17",
        "name_localized": "Medication Side Effects",
        "suggestion_localized": "Consult your healthcare provider to review medications.",
        "explanation_localized": "Some medications commonly used at an advanced age can have side effects including headaches, so it's important to monitor drug interactions and side effects."
      }
    ]
  },
  "echo": {
    "health_concern_input": "dor de cabeça",
    "user_info_input": {
      "gender": "female",
      "age_category": "senior",
      "age_specific": "60",
      "age_unit": "years"
    }
  }
